VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 'cardiac care. Several recent approaches employ pressure sensors, ultrasound, PPG and accelerometry. Ultrasound imaging of the IJV is the most established method, offering real-time clinical insights [ To address these limitations, Garca-Lpez  Other modalities include accelerometer-based sensing, which captures skin vibrations linked to jugular and carotid flow [ In the broader context of PPG-based cardiovascular assessment, Elgendi  Non-invasive monitoring of the JVP has advanced through various contactless techniques. Amelard  Further innovations include Tang  Microwave radar technologies have also been explored. A prototype utilizing 24 GHz radar demonstrated the feasibility of JVP measurement; however, challenges in qualitative pulse interpretation persist [ FMCW radar systems, at higher frequencies, have emerged as a viable solution for non-contact JVP monitoring.', '{-0.5165702700614929,-0.2987227141857147,-0.4680737257003784,-0.42555364966392517,-0.5513415932655334,0.48329785466194153,-1.1114211082458496,-0.010138997808098793,0.5521687865257263,-0.2664910554885864,-0.24573415517807007,0.18335269391536713,-0.3054916560649872,-0.5661135315895081,-0.8672754764556885,-0.21060746908187866,-0.6014403104782104,-0.3100506365299225,0.187787264585495,-0.3348411023616791,-0.385286420583725,-1.0222123861312866,-0.2995102107524872,0.24147450923919678,1.0099241733551025,0.25370025634765625,0.7365401983261108,0.11839766055345535,0.02106613479554653,0.286423921585083,-0.025850389152765274,0.11032501608133316,-0.9392339587211609,-0.02827414683997631,0.08099191635847092,-0.4697367250919342,-0.37416115403175354,0.7473354339599609,0.49118465185165405,-0.07265971601009369,-0.36482736468315125,-0.4476533830165863,-0.13912031054496765,-0.5890706181526184,-0.526199221611023,-0.14957627654075623,-0.04270659014582634,0.09219928830862045,0.12245936691761017,0.1461826115846634,0.2088676244020462,-0.8831044435501099,0