VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 16, 't in the environment. For reference, see electronic supplementary material, figure S8 in section S6. Our study explores a proof-of-concept technology for JVP detection using varying radar parameters, such as samples/chirp, chirps/frame and sampling frequency. Our findings, illustrated in  Detected JVP waveforms (red) overlaid on the full signal (blue); inset zooms into a JVP waveform marked by points indicating the ascent and descent of the waveform, respectively. The quality of the JVP signal changes with the bodys inclination, and this phenomenon is physiological. In a healthy person, the visible jugular veins are fully collapsed when standing and are often distended to a variable degree when the person is supine. Selecting an appropriate intermediate position permits the top of the column to become visible in the neck between the clavicle and the mandible. So, as the angle increases, the carotid pulse is expected to be more dominant compared with JVP, overshadowing its features.', '{-0.07424614578485489,0.1843620389699936,-0.8656991720199585,-0.5932273268699646,-0.009581371210515499,0.15002235770225525,-1.0464825630187988,-0.13067488372325897,0.8588597774505615,-0.017346905544400215,-0.08976776152849197,-0.18359296023845673,-0.005931118968874216,-0.42714691162109375,-0.939028799533844,-0.37089958786964417,-0.8839945197105408,-0.2555055022239685,0.4441573917865753,-0.10681970417499542,0.20116938650608063,-1.021249532699585,0.4154399037361145,0.1673731654882431,1.308058738708496,0.14934995770454407,0.7095814943313599,0.4119652807712555,0.059688035398721695,0.33320459723472595,-0.21809738874435425,-0.1052655428647995,-0.89955735206604,-0.48473671078681946,-0.4841209352016449,-0.4110473096370697,0.3194878101348877,0.4624440670013428,0.5681974291801453,0.1739194542169571,-0.7331917881965637,-0.312765508890152,0.420896977186203,-0.11180088669061661,0.019257264211773872,-0.016981948167085648,-0.263