VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 18, 'CHF conditions. In  Frequency spectrum comparison of RHC CVP signal and sensor recorded JVP signal. Both spectra are shown in normalized amplitude (dB) over a frequency range, emphasizing the frequency components and amplitudes that are characteristic of cardiovascular waveforms. Of note, CVP is an invasive measure, and JVP is a non-invasive measure that reflects the right atrial pressure. Due to the non-invasive nature, there will be timing delays and attenuation because of the distance between the jugular vein and the right atrium. Also, JVP can be influenced by factors like the patients position, neck angle and even breathing pattern, which might not directly affect CVP. Nonetheless, the correlation between them confirms that JVP can serve as a useful non-invasive estimate for understanding right heart health. This study demonstrates the feasibility of using a 60 GHz FMCW radar for non-invasive JVP extraction.', '{-0.08298743516206741,-0.5143203139305115,-0.5355067253112793,-0.5282921195030212,-0.3624136745929718,0.4403316378593445,-0.6465564370155334,-0.1926034390926361,0.4473783075809479,-0.6356813311576843,0.050722893327474594,0.22341181337833405,0.017996737733483315,-0.5925353765487671,-0.3359679877758026,-0.3037908971309662,-0.08361401408910751,0.49803024530410767,0.7297791838645935,-0.4563639163970947,-0.2079032063484192,-0.862861692905426,-0.07059463858604431,0.269871324300766,1.601723551750183,0.2793685495853424,0.973020613193512,0.055494360625743866,-0.28028592467308044,-0.08997096121311188,-0.16267359256744385,0.34779396653175354,-1.1308354139328003,-0.22771954536437988,0.03661319985985756,-0.4053404629230499,0.0008315714076161385,0.35328900814056396,0.46097901463508606,-0.10156261175870895,-0.2890985906124115,-0.8315302729606628,0.060293011367321014,-0.6824501752853394,0.06406347453594208,-0.5654776096343994,0.2418285459280014,0.11835934221744537,-0.06522110104560852,-0.0453586317