VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Ovarian cystic tumors are common in adult women. However, cases of ovarian cystic tumors approximately 30cm in diameter are rarely reported in adult women and even rarer in children. Here, we report a rare case of a giant ovarian cystic tumor in a 13-year-old girl. A 13-year-old girl was admitted to hospital with abdominal pain and distension for 7 days. The parents felt anxious about the childs abdominal lesions and requested laparoscopic surgery. After evaluation at our hospital, abdominal color ultrasound and enhanced computer tomography revealed a large sac-like fluid density shadow with clear edges in the abdomen, approximately 38cm  35cm  24cm in size. We performed a laparoscopic resection of the cystic ovarian tumor, which was pathologically confirmed as a benign ovarian tumor. Subsequently, laparoscopic exploration revealed a huge cystic tumor originated from the right ovary with a clear boundary between the tumor and the right ovary.', '{0.029516393318772316,-0.09343565255403519,-0.19007425010204315,0.5259285569190979,-0.9760981798171997,0.09241675585508347,-0.061029527336359024,-0.616949200630188,-0.17509791254997253,0.37284910678863525,0.02324587106704712,0.8657503128051758,-0.38601043820381165,-0.02352309226989746,0.2482822984457016,-0.14421364665031433,-1.4163907766342163,0.6325854063034058,1.0195090770721436,-0.4531993269920349,-0.2445591688156128,-0.39833274483680725,-0.659812867641449,0.9959978461265564,0.08684254437685013,0.30647268891334534,-0.11322131752967834,-0.21018072962760925,-1.354393720626831,-0.6593050360679626,-0.6062496900558472,0.25384387373924255,0.5941888093948364,0.430691659450531,0.03777842968702316,0.13613642752170563,0.5692300200462341,0.379547119140625,-1.2465143203735352,0.24573218822479248,-1.041863203048706,-0.4729577302932739,0.23361751437187195,0.07824955135583878,0.8925676345825195,0.6357746124267578,-0.06609396636486053,0.43141037225723267,0.1269326508