VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'cyst wall had single cubic epithelium in the pathological image of 100. HE = hematoxylin and eosin. Figure  The nursing roadmap in this paper is shown in Figure  Nursing roadmap. CT = computer tomography. Among ovarian cysts, giant ovarian cysts in children are rare. The specific cause of ovarian cysts is unclear; however, it is believed to be related to environment, diet, endocrine, heredity, and so on. Ovarian cysts can be divided into functional, neoplastic, endometritic, and tubal. Functional cysts are relatively rare in children, mainly luteal and follicular cysts, and most resolve spontaneously under observation or drug intervention. Ovarian cysts have no specific symptoms. A few are found due to torsion, rupture, and acute abdomen, most are inadvertently found during physical examination. Mesenteric and retroperitoneal cystic tumors should also be considered in the differential diagnosis of large cystic tumors in the abdominal cavity of children.', '{-0.3976415991783142,0.4456818401813507,0.3964451551437378,0.0649852454662323,-0.7971119284629822,0.4567359983921051,0.12906692922115326,-0.6443827152252197,-0.6053389310836792,0.1677950918674469,0.20305180549621582,0.5665196180343628,-0.11806800961494446,0.3185752034187317,-0.3077312111854553,-0.4988647997379303,-1.1217509508132935,0.027100563049316406,0.7765067219734192,-0.5970659852027893,-0.6066139936447144,-0.5486170053482056,-0.6202008724212646,0.8914255499839783,-0.27349695563316345,-0.2056163102388382,-0.6313961744308472,-0.04656986519694328,-0.8955756425857544,-0.45248153805732727,-0.4209526479244232,0.0036006371956318617,0.5093428492546082,0.30461743474006653,0.060292210429906845,-0.18757006525993347,0.309719979763031,0.3937954306602478,-0.8662834763526917,0.23554766178131104,-0.648064911365509,-0.3990161418914795,-0.24772387742996216,0.44309625029563904,0.43601009249687195,-0.14698532223701477,0.24173055589199066,0.5433080196380615,