VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'd as crucial, leading to the development and validation of a diagnostic nomogram with high accuracy. Immune cell analysis: Female RA patients were found to have lower levels of macrophages and neutrophils, highlighting gender-based differences in immune cell function. Mendelian randomization insights: The study used MR analysis to uncover the specific role of the RETN gene in seronegative RA patients, particularly in females. Clinical implications: The findings provide a foundation for developing personalized treatment strategies tailored to the gender-specific mechanisms of RA. Rheumatoid arthritis (RA) is a chronic autoimmune disorder characterized by persistent joint inflammation, leading to pain, functional disability, and systemic complications such as cardiovascular disease, pulmonary fibrosis, and osteoporosis. These manifestations significantly impair patients quality of life and survival, with China facing a substantial disease burden of approximately 5 million cases.', '{0.9667388796806335,0.16614194214344025,0.9304346442222595,-0.1457335203886032,-0.6083791255950928,-0.05587974563241005,0.2303265631198883,0.5193830132484436,-0.7003464698791504,-0.3879920542240143,-0.13060083985328674,0.19870762526988983,0.4509804844856262,-0.0630863681435585,0.12752172350883484,0.17501096427440643,0.6215429306030273,-0.00833942461758852,0.3829052448272705,0.150534987449646,-0.5263181924819946,-0.14555968344211578,-0.045815471559762955,0.2323855608701706,-0.4010702669620514,-0.512710690498352,-0.2946678102016449,0.5568372011184692,0.18760229647159576,0.5500859618186951,0.2742244005203247,0.6670694351196289,-0.26775163412094116,-0.3594469726085663,-0.22281435132026672,0.11372024565935135,0.353439062833786,0.09850919246673584,-0.7971892356872559,0.10150495916604996,0.018177038058638573,0.13941869139671326,-0.15346568822860718,-0.6480737328529358,0.006855069659650326,-0.004292967729270458,0.52292555570602